/**
 * Yields the link to the current page.
 *
 * @example
 * ```ts
 *    cy.get('[data-testid="myNavComponent]')
 *      .then(currentLink)
 * ```
 */
export var getCurrentLink = function ($element) {
    return cy.wrap($element).get("[aria-current='page']");
};
/**
 * Yield link containing link name.
 *
 * @example
 * ```ts
 *    cy.get('[data-testid="myNavComponent]')
 *      .then(myLink)
 * ```
 */
export var getLink = function (linkName) { return function ($element) {
    return cy.wrap($element).get("a:contains(" + linkName + ")");
}; };
